		private String id;			//	private java.util.Date create_time;			//创建时间	private String create_by;			//创建对象	private java.util.Date update_time;			//更新时间	private String update_user;			//更新对象	private Integer is_deleted;			//逻辑删除标志0-未删除 1-已删除	private Integer is_disabled;			//启用 停用标志 1-已禁用 0-未禁用	private Integer version;			//版本号	private String pwr_org;			//权限架构	private String user_code;			//用户编号	private String user_name;			//用户名称	private String user_pwd;			//登陆密码	private String user_phone;			//手机	private String user_org_code;			//所属机构	private String user_remark;			//备注	public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public java.util.Date getCreate_time() {	    return this.create_time;	}	public void setCreate_time(java.util.Date create_time) {	    this.create_time=create_time;	}	public String getCreate_by() {	    return this.create_by;	}	public void setCreate_by(String create_by) {	    this.create_by=create_by;	}	public java.util.Date getUpdate_time() {	    return this.update_time;	}	public void setUpdate_time(java.util.Date update_time) {	    this.update_time=update_time;	}	public String getUpdate_user() {	    return this.update_user;	}	public void setUpdate_user(String update_user) {	    this.update_user=update_user;	}	public Integer getIs_deleted() {
